import { useState } from 'react'

const ListRender = () => {

    const [list] = useState([
        {id:1, name: "Matheus", age: 31},
        {id:2, name: "Diego", age: 37},
        {id:3, name: "Sergio", age: 45},
        
    ]);
    
    return (
    <div>
        <ul>
            {list.map((item, index) => (
                <li key={index}>{item}</li>
            ))}
        </ul>
    </div>
    )
}

export default ListRender
